const { Component } = require("react");


class Test extends Component {
    constructor() {
        super()
    }

    render = () => {
        return (
            <div>
                <div>
                    <iframe width="560" height="315" src="//www.plaid.com" frameborder="0" allowfullscreen></iframe>
                </div>
            </div>
        )
    }
}

export default Test;
